# 완주하지 못한 선수# 해시 알고리즘 사용하기def solution(participant, completion):    answer = ''    temp = 0    dic = {}    for part in participant:        dic[hash(part)] = part        temp += int(hash(part))    for com in completion:        temp -= hash(com)    answer = dic[temp]    return answerif __name__ == "__main__":    participant = ["leo", "kiki", "eden"]  # 참가자 명단    completion = ["eden", "kiki"]  # 완주자 명단    print(solution(participant, completion))